//Libraries
import AddIcon from "@material-ui/icons/Add";
//Local Libraries
import makeStyles from "./Add_item_styles";
const Add_item = () => {
	const styles = makeStyles();
	return (
		<div className={styles.root}>
			<AddIcon
				fontSize="inherit "
				classes={{ fontSizeInherit: styles.fontSizeInherit }}
			/>{" "}
			Add Item
		</div>
	);
};

export default Add_item;
